/*
MyAir: How to "edit" images or how to export existing Image data and re-import it:
1:  Copy/Paste original image HEX array from 01_ziffern.cpp into text file
2:  Remove "0x", "," "{", "}" Space and Newlines in text editor. This gets us a text file with only the HEX values.
3:  Save text as txt.
3:  Convert text file into binary with xxd in Bash Shell: 
    "xxd -r -p ziffernHEX.txt ziffern.data"
4:  Open ziffern.data in GIMP as "Rohdaten des Bilds":
      Bildtyp = "RGB565 Big-Endian" format 
      Breite = 50
      HÃ¶he = 770 (70*11)
5:  Edit image
6:  Export image as BMP.
7:  Load BMP in https://notisrac.github.io/FileToCArray/
      (source of converter site https://github.com/notisrac/FileToCArray)
8:  Set export parameters:
      Code Format = HEX (0x00)
      Palette Mod = 16 Bit RRRRRGGGGGGBBBBB (2 byte/pixel)
      Endianness = Little-Endian! (for some reason Big-Endian inverts the picute!)
      Data Type = uint16_t
9:  Click "Convert".
10: Copy/Paste generated 77000 Byte array data back into 11x3500 array in 01_ziffern_neu.cpp
11: Reformat array to get back the 11x3500 byte array:
      Insert "},{" after 3500 values 11 times. Each before hex value that is marked with squiggly red line in VsCode.
12: Change #include in tft_display.cpp to reference new 01_ziffern_neu.cpp.
*/

